import Phaser from "phaser";
import ScoreLabel from "../ui/ScoreLabel";
import BombSpawner from "./BombSpawner";

//KEYS
const SKY_KEY = "sky";
const GROUND_KEY = "ground";
const STAR_KEY = "star";
const BOMB_KEY = "bomb";
const DUDE_KEY = "dude";

const LEFT_KEY = "left";
const RIGHT_KEY = "right";
const TURN_KEY = "turn";

// Phase.Scene class allows you to put together different parcer game
// ie. gameover screen, login screen
export default class GameScene extends Phaser.Scene {
  // used to create and initalize an object instance of that class
  constructor() {
    // every game needs an id; give it a scene name
    super("game-scene");

    // (this.player = undefined),
    // (this.cursor = undefined);

    this.gameOver = false;
  }
  preload() {
    this.load.image(SKY_KEY, "assets/sky.png");
    this.load.image(GROUND_KEY, "assets/platform.png");
    this.load.image(STAR_KEY, "assets/candy_07_caramel.svg");
    this.load.image(BOMB_KEY, "assets/bomb.png");

    this.load.spritesheet(DUDE_KEY, "assets/dude.png", {
      frameWidth: 32,
      frameHeight: 48,
    });
  }
  create() {
    this.add.image(400, 300, SKY_KEY);

    // platform and stars are const because they do not move.
    const platforms = this.createPlatforms();
    this.player = this.createPlayer();
    this. stars = this.createStar();

    this.scoreLabel = this.createScoreLabel(16, 16, 0);

    this.bombSpawner = new BombSpawner(this, BOMB_KEY);
    const bombsGroup = this.bombSpawner.group

    this.physics.add.collider(this.player, platforms);
    this.physics.add.collider(this.stars, platforms);
    this.physics.add.collider(bombsGroup, platforms)
    this.physics.add.collider(this.player, bombsGroup, this.hitBomb, null, this)

    this.physics.add.overlap(this.player, this.stars, this.collectStar, null, this);

    this.cursors = this.input.keyboard.createCursorKeys();
  }
  update() {
    if(this.gameOver){
      return  
    }
    if (this.cursors.left.isDown) {
      this.player.setVelocityX(-160);
      this.player.anims.play(LEFT_KEY, true);
    } else if (this.cursors.right.isDown) {
      this.player.setVelocityX(160);
      this.player.anims.play(RIGHT_KEY, true);
    } else {
      this.player.setVelocityX(0);
      this.player.anims.play(TURN_KEY);
    }
    if (this.cursors.up.isDown && this.player.body.touching.down) {
      this.player.setVelocityY(-350);
    }
  }
  hitBomb(player){
    this.physics.pause()
    player.setTint(0xff0000)
    player.anims.play(TURN_KEY)
    this.gameOver = true
  }
  createStar() {
    const stars = this.physics.add.group({
      key: STAR_KEY,
      repeat: 11,
      setXY: { x: 12, y: 0, stepX: 70 },
    });
    stars.children.iterate((c) => {
      const child = /** @type {Phaser.Physics.Arcade.Sprite} */ (c);
      child.setBounceY(Phaser.Math.FloatBetween(0.4, 0.8));
    });
    return stars;
  }
  collectStar(player, star) {
    star.disableBody(true, true);

    this.scoreLabel.add(10);

    if(this.stars.countActive(true) === 0){
      // if no starts, a new batch of stars to collect will spawn
      this.stars.children.iterate((c) => {
        const child = /** @type {Phaser.Physics.Arcade.Sprite} */ (c);
        child.enableBody(true, child.x, 0, true, true)
      })
      // if there are no stars, a bomb will spawn
      this.bombSpawner.spawn(player.x)
    }
    //each stars collected, a bomb will spawn
    // this.bombSpawner.spawn(player.x)
  }
  createPlatforms() {
    // staticGroup (static), does not move, dynamic moves
    const platforms = this.physics.add.staticGroup();

    platforms.create(400, 568, GROUND_KEY).setScale(2).refreshBody();

    platforms.create(600, 400, GROUND_KEY);
    platforms.create(50, 250, GROUND_KEY);
    platforms.create(750, 220, GROUND_KEY);

    return platforms;
  }
  createScoreLabel(x, y, score) {
    const style = { fontsize: "32px", fill: "#000" };
    const label = new ScoreLabel(this, x, y, score, style);

    this.add.existing(label);

    return label;
  }
  createPlayer() {
    const player = this.physics.add.sprite(100, 250, DUDE_KEY);
    player.setBounce(0.2);
    player.setCollideWorldBounds(true);

    this.anims.create({
      key: LEFT_KEY,
      frames: this.anims.generateFrameNumbers(DUDE_KEY, { start: 0, end: 5 }),
      frameRate: 10,
      repeat: -1,
    });

    this.anims.create({
      key: TURN_KEY,
      frames: [{ key: DUDE_KEY, frame: 4 }],
      frameRate: 20,
    });

    this.anims.create({
      key: RIGHT_KEY,
      frames: this.anims.generateFrameNumbers(DUDE_KEY, { start: 5, end: 8 }),
      frameRate: 10,
      repeat: -1,
    });
    return player;
  }
}
